    }
    DatosMenu() {
        if (this.props.value) {
            return (
                <div>
                    <button></button>
                    <button></button>
                </div>
            )
        }else{
            <div>
                <button></button>
                <button></button>
            </div>
        }
    }
    render() {
        return(DatosMenu)
    }
}

export default Menu;
